import './App.css';
import InputContainer from './Components/InputContainer.js';
import Navbar from './Components/Navbar.js';
import Footer from './Components/Footer';
import LinkResult from './Components/LinkResult';


function App() {
  return (
    <>
      <Navbar/>
      <InputContainer />
      <LinkResult/> 
      <Footer />
    </>
    );
}

export default App;
